import { Stack } from '@mui/system'
import React from 'react';
import { category } from '../../Constants/Constants';

const Category = () => {
return (
    <Stack direction={'row'}>
        {category.map(item => (
            <button key={item.name} className='category-btn' style={{ borderRadius: '0'}}>
                <span>{item.icon}</span>
                <span>{item.name}</span>
            </button>
        ))}
    </Stack>
)
}

export default Category
